#include <iostream>
#include <fstream>
#include <vector>
#include <algorithm>


int main() {

    std::ifstream fin("input.txt");

    std::vector<std::pair<int, int>> vec(10001); // id, count

    int size, count, id;
    fin >> size;


    for (int i = 0; i < size; i++) {
        fin >> id;
        vec[id].first = id;
        vec[id].second++;
    }

    fin >> count;

    sort(vec.begin(), vec.end(), [](auto a, auto b) {
        if (a.second == b.second) {
            return a.first < b.first;
        }
        return a.second > b.second; });

    for (int i = 0; i < count; i++) {
        if (vec[i].second != 0) {
            std::cout << vec[i].first << " ";
        }
    }
}

#include <iostream>


void bracket(int count, std::string s = "", int left = 0, int right = 0) {
    if (left == count && right == count) {
        std::cout << s << std::endl;
        return;
    }
    if (left < count) {
        bracket(count, s + '(', left + 1, right);
    }
    if (right < left) {
        bracket(count, s + ')', left, right + 1);
    }
}


int main() {

    int count;
    std::cin >> count;
    bracket(count);
}

#include <iostream>
#include <vector>
#include <fstream>


void get_combo(const std::string& str, std::vector<std::string>& arr, std::string prefix = "", int index = 0) {
    if (index == str.size()) {
        std::cout << prefix << " ";
    }
    else {
        for (int i = 0; i < arr[str[index] - '2'].size(); i++) {
            get_combo(str, arr, prefix + arr[str[index] - '2'][i], index + 1);
        }
    }
}

int main() {
    setlocale(LC_ALL, "ru");

    std::vector<std::string> arr{ "abc", "def", "ghi", "jkl", "mno", "pqrs", "tuv", "wxyz" };

    std::string str;

    std::cin >> str;
   
    get_combo(str, arr);
}

